import React from 'react';
import './home.css'

class Home extends React.Component {
	render(){
		return(
			<>
			<div className="Nav_class"></div>
				<div className="jumbotron">
				</div>
				<div className="jumbotron"></div>
				<div className="flex">
					<div>1</div>
					<div>2</div>
					<div>3</div>
					<div>4</div>
					<div>5</div>
				</div>
			</>
		)
	}
}

export default Home;
